def getRGB(subSpan,start = 0):
	startPos = 0
	while(subSpan[start-4:start] != "rgb("):
		
		start+=1
	startPos = start
	while(subSpan[start] != ")"):

		start+=1
	RGBs = subSpan[startPos:start].split(",")
	for i in range(len(RGBs)):
		RGBs[i] = int(RGBs[i])
	return RGBs
def getVal(subSpan,start = 0):

	while(subSpan[start] != '>'):
		start+=1
	return subSpan[start+1]

def subSpan(stringIn, start = 0):
	#returns int which shows the are which the span, spans over
	startSpan = 0;
	endSpan = 0;
	for i in range(start,len(stringIn)):
		
		if (stringIn[i-2:i] == "n>" and startSpan != 0):
			endSpan = i
			return [startSpan,endSpan]
		if (stringIn[i:i+2] == "<s"):
			startSpan = i
		
			
	return [startSpan,endSpan]
	
def findNumber(r,g,b):
	RGB = [0,0,0]
	count = 16
	while RGB[0] < r or RGB[1] < g or RGB[2] < b :
		#print(RGB[2]+40)
		RGB[2] = addTo(RGB[2])
		RGB = overFlow(RGB)
		count+=1
	return count
def overFlow(lst):
	for i in range(len(lst)):
		curItem = len(lst) - i-1
		if (lst[curItem] > 255 and not curItem == 0):
			lst[curItem-1] = addTo(lst[curItem-1])
			lst[curItem] = 0

	return lst

def addTo(num):
	if (num == 0) :
		return 95
	else:
		return num+40
